import React, { useState, useEffect } from "react";
import {
  Container,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography,
  Paper,
  TextField,
} from "@mui/material";

export default function StatusDebtor() {
  const [participants, setParticipants] = useState([]);
  const [totalAmounts, setTotalAmounts] = useState({});
  const [payments, setPayments] = useState({});
  const [status, setStatus] = useState({});

  // Fetch stored data from localStorage when the component mounts
  useEffect(() => {
    const storedParticipants = JSON.parse(localStorage.getItem("participants")) || [];
    const storedTotalAmounts = JSON.parse(localStorage.getItem("totalAmounts")) || {};
    const storedPayments = JSON.parse(localStorage.getItem("payments")) || {};

    console.log("Participants:", storedParticipants);
    console.log("Total Amounts:", storedTotalAmounts);

    setParticipants(storedParticipants);
    setTotalAmounts(storedTotalAmounts);
    setPayments(storedPayments);

    // Initialize status for each participant
    const initialStatus = {};
    storedParticipants.forEach(participant => {
      initialStatus[participant] = "Pending"; // Set initial status to "Pending"
    });
    setStatus(initialStatus);
  }, []);

  // Handle updates to payment input and save to localStorage
  const handlePaymentChange = (participant, amount) => {
    const updatedPayments = {
      ...payments,
      [participant]: parseFloat(amount) || 0,
    };
    setPayments(updatedPayments);
    localStorage.setItem("payments", JSON.stringify(updatedPayments));

    // Update status based on payment
    if (updatedPayments[participant] >= (totalAmounts[participant]?.total || 0)) {
      setStatus((prevStatus) => ({
        ...prevStatus,
        [participant]: "Paid",
      }));
    } else {
      setStatus((prevStatus) => ({
        ...prevStatus,
        [participant]: "Pending",
      }));
    }
  };

  // Calculate remaining amount for each participant
  const calculateRemaining = (participant) => {
    const totalAmount = totalAmounts[participant]?.total || 0;
    const paidAmount = payments[participant] || 0;
    return totalAmount - paidAmount;
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Status of Debtors
      </Typography>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Participant</TableCell>
              <TableCell>Amount Owed</TableCell>
              <TableCell>Amount Paid</TableCell>
              <TableCell>Remaining</TableCell>
              <TableCell>Status</TableCell>
              <TableCell>Update Payment</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {participants.map((participant) => (
              <TableRow key={participant}>
                <TableCell>{participant}</TableCell>
                <TableCell>
  {totalAmounts[participant]?.total !== undefined
    ? totalAmounts[participant].total.toFixed(2) + " B"
    : "0.00 B"}
</TableCell>

                <TableCell>
                  {payments[participant] ? payments[participant].toFixed(2) : "0.00 B"}
                </TableCell>
                <TableCell>
                  {calculateRemaining(participant).toFixed(2)} B
                </TableCell>
                <TableCell>
                  {status[participant]}
                </TableCell>
                <TableCell>
                  <TextField
                    type="number"
                    label="Payment"
                    variant="outlined"
                    size="small"
                    value={payments[participant] || ""}
                    onChange={(e) => handlePaymentChange(participant, e.target.value)}
                  />
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Container>
  );
}
